import React from "react";
import {
	Card,
	CardImg,
	CardImgOverlay,
	CardTitle,
	Breadcrumb,
	BreadcrumbItem,
} from "reactstrap";
import { Link } from "react-router-dom";
import { GoogleSpreadsheet } from "google-spreadsheet";
import { private_key, client_email } from '../client_secret.json';

const doc = new GoogleSpreadsheet(
  "1uIxL7lcLbva5QqDsFtPGxGTUsADD5VW9mhgMPN6UjpA"
);
async function sheetsLogin () {
await doc.useServiceAccountAuth({
  client_email: creds.client_email,
  private_key: creds.private_key,
});
}

function Roster(props) {
	return (
		<div className="container main">
			<div className="row">
				<div className="col">
					<Breadcrumb>
						<BreadcrumbItem>
							<Link to="/home">Home</Link>
						</BreadcrumbItem>
						<BreadcrumbItem active>Roster</BreadcrumbItem>
					</Breadcrumb>
					<h2>Roster</h2>
					<hr />
				</div>
			</div>
			<div className="row row-content">
				<div className="col">
					<iframe
						src="https://docs.google.com/spreadsheets/d/e/2PACX-1vTc9HqJUZICNSrn2U4htiQMjvg74fVznQ3pFqpGhUru1POKttCL1NLJJcXV7LbSG40RG-zTNO0-myed/pubhtml?gid=0&amp;single=true&amp;widget=true&amp;headers=false"
						width="100%"
						height="600px"
					></iframe>
				</div>
			</div>
		</div>
	);
}

export default Roster;
